  match t with
  | TOKEN _ -> 0 
  | TYPE _ -> 1 
  | BAR  -> 2 
  | PERCENT_PERCENT  -> 3 
  | START  -> 4 
  | LEFT  -> 5 
  | RIGHT  -> 6 
  | NONASSOC  -> 7 
  | LESS  -> 8 
  | GREATER  -> 9 
  | COLON  -> 10 
  | PREC  -> 11 
  | SEMI  -> 12 
  | EOF  -> 13 
  | ERROR  -> 14 
  | HEADER _ -> 15 
  | CODE _ -> 16 
  | IDENT _ -> 17 

