  match tokenIdx with
  | 0 -> TOKEN_TOKEN 
  | 1 -> TOKEN_TYPE 
  | 2 -> TOKEN_BAR 
  | 3 -> TOKEN_PERCENT_PERCENT 
  | 4 -> TOKEN_START 
  | 5 -> TOKEN_LEFT 
  | 6 -> TOKEN_RIGHT 
  | 7 -> TOKEN_NONASSOC 
  | 8 -> TOKEN_LESS 
  | 9 -> TOKEN_GREATER 
  | 10 -> TOKEN_COLON 
  | 11 -> TOKEN_PREC 
  | 12 -> TOKEN_SEMI 
  | 13 -> TOKEN_EOF 
